import React from 'react'
import { Link } from 'react-router-dom'
import Validation from './SignupValidation'

function Signup() {
    const [values, setValues]= useState({
        
        email: '',
        password: ''
    })

    const [errors,setErrors] = useState({}) 

    const handleInput = (event)=>{
        setValues(prev =>({...prev, [event.target.name]: [event.target.value]}))
    }

    const handleSubmit = (event)=>{
        event.preventDefault();
        setErrors(Validation(values));
    }

  return (
    <div className='d-flex justify-content-center align-items-center bg-primay vh-100'>
    <div className='bg-white p-3 rounded w-25'>
        <h2>Sign-up</h2>
        <form action=''>
        <div className='mb-3'>
                <label htmlFor='name'><strong>Name</strong></label>
                <input type='text' placeholder='Enter Name' className='form-control rounded-0'/>
            </div>

            <div className='mb-3'>
                <label htmlFor='email'><strong>Email</strong></label>
                <input type='email' placeholder='Enter Email' className='form-control rounded-0'/>
            </div>

            <div className='mb-3'>
                <label htmlFor='password'><strong>Password</strong></label>
                <input type='password' placeholder='Enter Password' className='form-control rounded-0'/>
            </div>
            <button className='btn btn-success w-100 rounded-0'><strong>Signup</strong></button>
            <p> You are agree to our terms and policies </p>
            <Link to="/" className='btn btn-default border w-100 bg-light rounded-0 text-decoration-none' >Login</Link>
        </form>
    </div>
</div>
  )
}

export default Signup
